						["subeventPrefix"] = "SPELL",
						["events"] = "BAG_UPDATE, PLAYER_ENTERING_WORLD, UNIT_INVENTORY_CHANGED, PLAYER_TARGET_CHANGED,CHAT_MSG_SKILL, UNIT_POWER_UPDATE:player",
						["customName"] = "function()\n  local debug = '';\n  local weaponSkill = 0;\n  local rweaponSkill = 0;\n  local targetLevel = UnitLevel('target');\n  local itemId = GetInventoryItemID('player', 16);\n  local ritemId = GetInventoryItemID('player', 18);\n  local itemSubType = '..++..';\n  if itemId ~= nil then\n    sName, sLink, iRarity, iLevel, iMinLevel, sType, sSubType, iStackCount = GetItemInfo(itemId);\n    sSubType = string.gsub(sSubType, 'One%-Handed ', '');\n    --message(sSubType);\n    --debug = debug .. '['.. sSubType  ..']\\n';\n  end\n  if ritemId ~= nil then\n    rsName, rsLink, riRarity, riLevel, riMinLevel, rsType, rsSubType, riStackCount = GetItemInfo(ritemId);\n    --rsSubType = string.gsub(rsSubType, 'One%-Handed ', '');\n    --message(rsSubType);\n    --debug = debug .. '['.. rsSubType  ..']\\n';\n  end\n  --debug = debug .. '['.. sSubType  ..']\\\\n\\\\n';\n  \n  local defenseSkillCombined = 0;\n  --debug = debug .. sSubType .. '\\\\n';\n  --debug = debug .. itemLink..'\\\\n';\n  -- Get Skills that Matter\n  for skillIndex = 1, GetNumSkillLines() do\n    --debug = debug .. sSubType .. '\\\\n';\n    local skillName, isHeader, isExpanded, skillRank, numTempPoints, skillModifier = GetSkillLineInfo(skillIndex)\n    if not isHeader then\n      --debug = debug .. (string.format(\\\"Skill: [%s] - [%s] - [%s]\\\", skillName, skillRank, skillModifier)) .. '\\\\n';\n    end\n    --result = string.find(skillName, sSubType);\n    --if result ~= nil then\n    --message(result);\n    --end\n    if (skillName == sSubType) then\n      weaponSkill = skillRank + skillModifier;\n    else\n      --debug = debug .. string.format(\\\"Skill: [%s] - [%s]\\\", skillName, sSubType) .. '\\\\n';\n    end\n    if (skillName == rsSubType) then\n      rweaponSkill = skillRank + skillModifier;\n    else\n      --debug = debug .. string.format(\\\"Skill: [%s] - [%s]\\\", skillName, sSubType) .. '\\\\n';\n    end\n  end\n  --message(weaponSkill);\n  local critChance = string.format(\"%.2f\",GetCritChance())\n  local base, posBuff, negBuff = UnitAttackPower(\"player\");\n  local ap = base + posBuff + negBuff;\n  local rbase, rposBuff, rnegBuff = UnitRangedAttackPower(\"player\");\n  local rap = rbase + rposBuff + rnegBuff;\n  local hitRating = string.format(\"%.2f\",GetHitModifier());\n  local rhitRating = string.format(\"%.2f\",GetHitModifier());\n  -- colorize\n  if targetLevel <= 0 then targetLevel = 63; end\n  local targetDefense = targetLevel * 5;\n  local targetAttack = targetLevel * 5;\n  local missChance = 0;\n  if targetDefense - weaponSkill <= 10 then\n    missChance = 5 + (targetDefense - weaponSkill)*.1;\n  else\n    missChance = 7 + (targetDefense - weaponSkill -10)*.4;\n  end\n  if targetDefense - rweaponSkill <= 10 then\n    rmissChance = 5 + (targetDefense - rweaponSkill)*.1;\n  else\n    rmissChance = 7 + (targetDefense - rweaponSkill -10)*.4;\n  end\n  if (missChance < 0) then missChance = 0 end\n  if (rmissChance < 0) then rmissChance = 0 end\n  if GetHitModifier() < missChance then\n    hitRating = '|cFFFF0000'.. hitRating;\n  else\n    hitRating = '|cFF00FF00'.. hitRating;\n  end\n  if GetHitModifier() < rmissChance then\n    rhitRating = '|cFFFF0000'.. rhitRating;\n  else\n    rhitRating = '|cFF00FF00'.. rhitRating;\n  end\n  hitRating = hitRating .. ' ('.. missChance ..'% needed ['.. weaponSkill ..']) |cFFFFFFFF';\n  rhitRating = rhitRating .. ' ('.. rmissChance ..'% needed ['.. rweaponSkill ..']) |cFFFFFFFF';\n  --5% + (Defense Skill - Attack Rating) * 0.04%\n  \n  --local output = \"\\n\"    \n  \n  local output = ''.. debug .. \n  'Hit:   ' .. hitRating .. '\\n' ..\n  --  'rHit:  ' .. rhitRating .. '\\n' ..\n  'Crit:  ' .. critChance ..'\\n'..\n  --  'RAP:   ' .. rap ..'\\n' ..\n  'AP:    ' .. ap ..'\\n' ..\n  --'----------\\n' ..\n  ''\n  \n  return output\nend",
