			["actions"] = {
				["start"] = {
				},
				["init"] = {
					["custom"] = "-- List of debuffs to track\n-- Format: [\"{Debuff Name}\"] = \"{Display Name for Chat}\",\naura_env.cc_spells = {\n    [\"Polymorph\"] = \"Poly\",\n    [\"Shackle Undead\"] = \"Shackle\",\n    [\"Freezing Trap Effect\"] = \"IceTrap\",\n    [\"Sap\"] = \"Sap\",\n    [\"Seduction\"] = \"Seduce\",\n    [\"Hibernate\"] = \"Hiber\",\n}\n\naura_env.poly_tbl = {}\n\naura_env.nil2str = function(msg)\n    if msg == nil then\n        return \"nil\"\n    elseif msg == true then\n        return \"true\"\n    elseif msg == false then\n        return \"false\"\n    else\n        return msg\n    end\nend\n\nlocal RaidIconMaskToIndex = {\n    [COMBATLOG_OBJECT_RAIDTARGET1] = 1,\n    [COMBATLOG_OBJECT_RAIDTARGET2] = 2,\n    [COMBATLOG_OBJECT_RAIDTARGET3] = 3,\n    [COMBATLOG_OBJECT_RAIDTARGET4] = 4,\n    [COMBATLOG_OBJECT_RAIDTARGET5] = 5,\n    [COMBATLOG_OBJECT_RAIDTARGET6] = 6,\n    [COMBATLOG_OBJECT_RAIDTARGET7] = 7,\n    [COMBATLOG_OBJECT_RAIDTARGET8] = 8\n}\n\naura_env.get_raidmarker_msg = function(destRaidFlags)\n    local msg_raidmarker = \"\"\n    local raidmarker_id = bit.band(destRaidFlags,COMBATLOG_OBJECT_RAIDTARGET_MASK)\n    if raidmarker_id > 0 then\n        raidmarker_id = RaidIconMaskToIndex[raidmarker_id]\n        if raidmarker_id >= 1 and raidmarker_id <= 8 then\n            if IsInRaid() or IsInGroup() then\n                --msg_raidmarker = \" {rt\" .. raidmarker_id .. \"}\"\n                msg_raidmarker = \" \\124TInterface\\\\TargetingFrame\\\\UI-RaidTargetingIcon_\" .. raidmarker_id ..\":12\\124t\"\n            else\n                msg_raidmarker = \" \\124TInterface\\\\TargetingFrame\\\\UI-RaidTargetingIcon_\" .. raidmarker_id ..\":12\\124t\"\n            end\n        end\n    end\n    return msg_raidmarker\nend",
					["do_custom"] = true,
				},
				["finish"] = {
				},
			},
			["triggers"] = {
				{
					["trigger"] = {
						["type"] = "custom",
						["custom_type"] = "event",
						["event"] = "Health",
						["names"] = {
						},
						["debuffType"] = "HELPFUL",
						["subeventPrefix"] = "SPELL",
						["events"] = "COMBAT_LOG_EVENT_UNFILTERED",
						["spellIds"] = {
						},
						["unit"] = "player",
						["subeventSuffix"] = "_CAST_START",
						["custom"] = "function(event, ts, subEvent, a1, sourceGUID, sourceName, a4, a5, destGUID, destName, destFlags, destRaidFlags, spellID, spellName, a12, a13, a14, a15, a16, a17, a18)    \n  \n  -- Player sheeps a target\n  if subEvent == \"SPELL_AURA_APPLIED\" and aura_env.cc_spells[spellName] then\n    if UnitIsPlayer(sourceName) or UnitInParty(sourceName) or UnitInRaid(sourceName) then\n      aura_env.poly_tbl[destGUID] = {ts_active=ts,ts_inactive=nil,active=true,broken=false,ccbreaker_name=nil,ccbreaker_ts=nil,ccbreaker_spell=nil,cc_spell=aura_env.cc_spells[spellName]}\n    end\n  end\n  \n  -- Sheep broken\n  if subEvent and subEvent:find(\"SPELL_AURA_BROKEN\") and aura_env.cc_spells[spellName] and aura_env.poly_tbl[destGUID] and aura_env.poly_tbl[destGUID].active then\n    aura_env.poly_tbl[destGUID].cc_spell = aura_env.cc_spells[spellName]\n    aura_env.poly_tbl[destGUID].ts_inactive = ts\n    aura_env.poly_tbl[destGUID].active = false\n    aura_env.poly_tbl[destGUID].broken = true\n    -- Special case for when melee attack damage timestamp does not line up with sheep break timestamp\n    if aura_env.poly_tbl[destGUID].ccbreaker_ts and (aura_env.poly_tbl[destGUID].ccbreaker_ts <= ts) and ((ts-aura_env.poly_tbl[destGUID].ccbreaker_ts) < 1.5) then\n      local msg_raidmarker = aura_env.get_raidmarker_msg(destRaidFlags)\n      -- local msg_polybreaker = aura_env.poly_tbl[destGUID].cc_spell .. \": \" .. destName .. msg_raidmarker .. \" < \" .. aura_env.nil2str(aura_env.poly_tbl[destGUID].ccbreaker_name) .. \" (\" .. aura_env.nil2str(aura_env.poly_tbl[destGUID].ccbreaker_spell) .. \")\"\n      local msg_polybreaker = aura_env.poly_tbl[destGUID].cc_spell .. \" on \" .. destName .. msg_raidmarker .. \" broken by: \" .. aura_env.nil2str(aura_env.poly_tbl[destGUID].ccbreaker_name) .. \" (\" .. aura_env.nil2str(aura_env.poly_tbl[destGUID].ccbreaker_spell) .. \")\"\n      \n      if IsInRaid() then\n        --SendChatMessage(msg_polybreaker,\"RAID\")\n        print(msg_polybreaker)\n      elseif IsInGroup() then\n        --SendChatMessage(msg_polybreaker,\"PARTY\")\n        print(msg_polybreaker)\n      else\n        print(msg_polybreaker)\n      end\n      aura_env.poly_tbl[destGUID].active = false\n      aura_env.poly_tbl[destGUID].broken = false\n      aura_env.poly_tbl[destGUID].ccbreaker_name = nil\n      aura_env.poly_tbl[destGUID].ccbreaker_ts = nil\n      aura_env.poly_tbl[destGUID].ccbreaker_spell = nil\n    end\n  end\n  \n  -- Sheep aura removed\n  if subEvent and subEvent == \"SPELL_AURA_REMOVED\" and aura_env.cc_spells[spellName] and aura_env.poly_tbl[destGUID] and aura_env.poly_tbl[destGUID].active then\n    aura_env.poly_tbl[destGUID].cc_spell = aura_env.cc_spells[spellName]\n    aura_env.poly_tbl[destGUID].ts_inactive = ts\n    aura_env.poly_tbl[destGUID].active = false\n    aura_env.poly_tbl[destGUID].broken = false\n    aura_env.poly_tbl[destGUID].ccbreaker_name = nil\n    aura_env.poly_tbl[destGUID].ccbreaker_ts = nil\n    aura_env.poly_tbl[destGUID].ccbreaker_spell = nil\n    local msg_raidmarker = aura_env.get_raidmarker_msg(destRaidFlags)\n    --local msg_polybreaker = aura_env.poly_tbl[destGUID].cc_spell .. \": \" .. destName .. msg_raidmarker .. \" < \" .. sourceName .. \" (Expired)\"\n    local msg_polybreaker = aura_env.poly_tbl[destGUID].cc_spell .. \" on \" .. destName .. msg_raidmarker .. \" expired. CC'd by: \" .. sourceName\n    if IsInRaid() then\n      --SendChatMessage(msg_polybreaker,\"RAID\")\n      print(msg_polybreaker)\n    elseif IsInGroup() then\n      --SendChatMessage(msg_polybreaker,\"PARTY\")\n      print(msg_polybreaker)\n    else\n      print(msg_polybreaker)\n    end\n  end\n  \n  -- Damage done to sheep\n  if subEvent and subEvent:find(\"DAMAGE\") and aura_env.poly_tbl[destGUID] then\n    -- This is to cover the case where the damage ts doesn't happen at the same time as the poly aura break ts\n    if aura_env.poly_tbl[destGUID].active and aura_env.poly_tbl[destGUID].ccbreaker_ts == nil then\n      aura_env.poly_tbl[destGUID].ccbreaker_name = sourceName\n      aura_env.poly_tbl[destGUID].ccbreaker_ts = ts\n      if subEvent == \"SWING_DAMAGE\" then\n        aura_env.poly_tbl[destGUID].ccbreaker_spell = \"Melee\"\n      else\n        aura_env.poly_tbl[destGUID].ccbreaker_spell = spellName\n      end\n    elseif not aura_env.poly_tbl[destGUID].active and aura_env.poly_tbl[destGUID].broken and ts == aura_env.poly_tbl[destGUID].ts_inactive then\n      local msg_polybreaker\n      local msg_raidmarker = aura_env.get_raidmarker_msg(destRaidFlags)\n      if subEvent == \"SWING_DAMAGE\" then\n        --msg_polybreaker = aura_env.poly_tbl[destGUID].cc_spell .. \": \" .. destName .. msg_raidmarker .. \" < \" .. aura_env.nil2str(sourceName) .. \" (Melee)\"\n        msg_polybreaker = aura_env.poly_tbl[destGUID].cc_spell .. \" on \" .. destName .. msg_raidmarker .. \" broken by: \" .. aura_env.nil2str(sourceName) .. \" (Melee)\"\n      else\n        --msg_polybreaker = aura_env.poly_tbl[destGUID].cc_spell .. \": \" .. destName .. msg_raidmarker .. \" < \" .. aura_env.nil2str(sourceName) .. \" (\" .. aura_env.nil2str(spellName) .. \")\"\n        msg_polybreaker = aura_env.poly_tbl[destGUID].cc_spell .. \" on \" .. destName .. msg_raidmarker .. \" broken by: \" .. aura_env.nil2str(sourceName) .. \" (\" .. aura_env.nil2str(spellName) .. \")\"\n      end\n      if IsInRaid() then\n        SendChatMessage(msg_polybreaker,\"RAID\")\n        --print(msg_polybreaker)\n      elseif IsInGroup() then\n        SendChatMessage(msg_polybreaker,\"PARTY\")\n        --print(msg_polybreaker)\n      else\n        print(msg_polybreaker)\n      end\n      aura_env.poly_tbl[destGUID].broken = false\n    end\n  end\nend",
