			["customText"] = "function()\n    if not aura_env.state.bucketing and aura_env.state.total and aura_env.state.total > 0 then\n        return string.format(\"%.0f%%\", aura_env.state.value/aura_env.state.total * 100)    \n    end\nend\n\n\n",
