						["customDuration"] = "",
						["custom"] = "-- GROUP_ROSTER_UPDATE, PLAYER_ENTERING_WORLD, WA_EVENT_RESCAN, UNIT_HEALTH, UNIT_MAXHEALTH, UNIT_POWER_UPDATE, UNIT_MAXPOWER, UNIT_DISPLAYPOWER, \nfunction (a, event, arg1, arg2)\n    local init = aura_env:Initialize(a)\n    local res = nil\n    if event == \"PLAYER_ENTERING_WORLD\" and arg1 == nil then\n        local id = aura_env.id\n        C_Timer.After(1.5, function() WeakAuras.ScanEvents(\"WA_EVENT_RESCAN\", id) end)\n    elseif event == \"UNIT_HEALTH\" and arg1 then\n        res = aura_env:Update(a, aura_env.rev.health, \"value\", arg1, \"health\", \"cur\", UnitHealth(arg1))\n    elseif event == \"UNIT_MAXHEALTH\" and arg1 then\n        res = aura_env:Update(a, aura_env.rev.health, \"total\", arg1, \"health\", \"max\", UnitHealthMax(arg1))\n    elseif event == \"UNIT_POWER_UPDATE\" and arg1 then\n        res = aura_env:Update(a, aura_env.rev.mana,   \"value\", arg1, \"mana\",   \"cur\", UnitPower(arg1,0))\n    elseif event == \"UNIT_MAXPOWER\" and arg1 then\n        res = aura_env:Update(a, aura_env.rev.mana,   \"total\", arg1, \"mana\",   \"max\", UnitPowerMax(arg1,0))\n    elseif event == \"UNIT_DISPLAYPOWER\" and arg1 then\n        res = aura_env:OnDisplayPowerUpdate(a, arg1, UnitPowerType(arg1))\n    elseif event == \"GROUP_ROSTER_UPDATE\"\n    or     event == \"PLAYER_ENTERING_WORLD\" and arg1 ~= nil\n    or     event == \"WA_EVENT_RESCAN\" and arg1 == aura_env.id\n    then\n        res = aura_env:OnGroupRosterUpdate(a)\n    end\n    \n    return res or init\nend",
