						["customIcon"] = "function()\n    local _, _, spellIcon = GetSpellInfo(shot_id)\n    return spellIcon\nend",
						["custom_hide"] = "timed",
						["custom"] = "function(event, ...)\n    local aimed_shot_ranks = {19434, 20900, 20901, 20902, 20903, 20904}\n    local multi_shot_ranks = {2643, 14288, 14289, 14290, 25294}\n    local playerName = UnitName(\"player\")\n    if event == \"UNIT_SPELLCAST_SENT\" then\n        spell = select(4,...)\n    end\n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local subevent = select(2,...)\n        local player = select(5, ...)\n        if subevent == \"SPELL_CAST_START\" and player == playerName then\n            if aura_env.config[\"aimed_shot\"] then\n                for i = 1, table.getn(aimed_shot_ranks) do\n                    if aimed_shot_ranks[i] == spell then\n                        shot_id = spell\n                        return true\n                    end\n                end\n            end\n            if aura_env.config[\"multi_shot\"] then\n                for i = 1, table.getn(multi_shot_ranks) do\n                    if multi_shot_ranks[i] == spell then\n                        shot_id = spell\n                        return true\n                    end\n                end    \n            end\n        end\n    end    \nend",
						["use_cloneId"] = false,
						["spellName"] = "Aimed Shot",
						["unevent"] = "auto",
						["type"] = "custom",
						["events"] = "COMBAT_LOG_EVENT_UNFILTERED, UNIT_SPELLCAST_SENT, UNIT_SPELLCAST_INTERRUPTED, UNIT_SPELLCAST_SUCCEEDED",
						["subeventSuffix"] = "_CAST_START",
						["use_spellName"] = true,
						["spell"] = "aimed shot",
						["event"] = "Cast",
						["custom_type"] = "status",
						["customDuration"] = "function()\n    local buffs = {3045, 26635, 6150}\n    local _, _, _, castTime = GetSpellInfo(shot_id)\n    castTime = castTime / 1000\n    calcTime = castTime\n    for i=1,40 do\n        local _, _, _, _, _, _, _, _, _, buffId = UnitBuff(\"player\",i)\n        if buffId == buffs[1] then -- Rapid Fire\n            calcTime = calcTime - (castTime - castTime / 1.4)\n        end\n        if buffId == buffs[2] then -- Troll Racial\n            healthProcent = UnitHealth(\"player\") / UnitHealthMax(\"player\") * 100\n            if healthProcent >= 40 then\n                berserkBonus = 1.1 * (1.3 - (healthProcent - 40)  / 2)\n            end\n            if healthProcent < 40 then\n                berserkBonus = 1.1 * 1.3\n            end\n            calcTime = calcTime - (castTime - castTime / berserkBonus)\n        end\n        if buffId == buffs[3] then -- Quick Shots\n            calcTime = calcTime - (castTime - castTime / 1.3)\n        end\n        \n    end\n    if castTime == 0 then\n        calcTime = 0.3\n    end\n    return calcTime, calcTime + GetTime()\nend",
