				["start"] = {
					["do_message"] = false,
					["do_custom"] = true,
					["custom"] = "if aura_env.state and aura_env.state.idx then\n    local frame_name = string.format(\"WeakAura_overlay_%s_%s\", aura_env.id, aura_env.state.idx)\n    local frame = _G[frame_name]\n    if frame then\n        frame:Show()\n    end\nend",
				},
				["init"] = {
					["custom"] = "aura_env.TriggerScanAfter = function(self, unitid, skip_rangecheck)\n    local name = UnitName(unitid)\n    -- must be a unit we care about\n    if self.unit_names[name] == nil then return end\n    -- CLEU should cover most things, so throttling on in range \n    -- units is higher.\n    local delay = self.config.delay\n    if not skip_rangecheck and UnitInRange(unitid) then\n        delay = delay + self.config.inrange_delay\n    end\n    local t = (self.last_update[name] or 0) + delay\n    -- if there is a update pending that happens before we exit\n    if self.pending_update[name] and self.pending_update[name] <= t then\n        return \n    end\n    self.pending_update[name] = t\n    local id = self.id\n    local fun = function()\n        WeakAuras.ScanEvents(\"WA_EVENT_RESCAN_UNIT\", id, name)\n    end\n    C_Timer.After(max(0,t-GetTime()), fun)\nend\n\n\naura_env.ProcessCLEU = function(self, allstates, applied,\n        _, dstName, dstFlags, _, --dst args\n    _id, spell_name, _school) -- prefix args\n    local res = nil\n    if  dstFlags and\n    bit.band(0x7,dstFlags) ~= 0 and -- only player 0x1 or group 0x2 or raid 0x4\n    bit.band(0xfcf0,dstFlags) == 0x0410 then -- type:player reaction:friendly\n        local t_name = self.buffname_rev[spell_name]\n        if t_name then\n            for idx,v in pairs(t_name) do\n                if v then\n                    -- sure this isn't good enough if we are xrealm with \n                    -- player of same name but who cares.\n                    dstName = string.split(\"-\", dstName)\n                    local prev_states = self.unit_buff_state[dstName]\n                    local s = allstates[idx]\n                    if prev_states ~= nil and prev_states[idx] ~= nil and s then\n                        if applied and not prev_states[idx] then\n                            s.changed = true\n                            s.value = s.value + 1\n                            res = true\n                        elseif not applied and prev_states[idx] then\n                            s.changed = true\n                            s.value = s.value - 1\n                            res = true\n                        end\n                        self.unit_buff_state[dstName][idx] = applied\n                    end\n                end\n            end\n        end\n        local t_id = self.buffname_scan[spell_name]\n        if t_id then\n            self:TriggerScanAfter(dstName, true)\n        end\n    end\n    return res\nend\n\naura_env.RescanUnit = function(self, allstates,name)\n    local res = nil\n    if self.unit_names[name] == nil then return res end\n    if self.pending_update[name] == nil then return res end\n    self.pending_update[name] = nil\n    self.last_update[name] = GetTime()\n    -- copy previous buff state, assume unit lost everything\n    local prv_state = {}\n    local cur_state = self.unit_buff_state[name]\n    for idx,v in pairs(cur_state) do\n        prv_state[idx] = v\n        cur_state[idx] = false\n    end\n    -- loop over all buffs, mark tracked buffs that we find\n    for i=1,40 do\n        -- lol... we need 1st and 10th value\n        local buffname,_,_,_,_,_,_,_,_,spellid = UnitBuff(name,i)\n        if not buffname then break end\n        local name_t = self.buffname_rev[buffname]\n        if name_t then\n            for idx,v in pairs(name_t) do\n                if v and cur_state[idx] ~= nil then\n                    cur_state[idx] = true\n                end\n            end\n        end\n        local id_t = self.spellid_rev[spellid]\n        if id_t then\n            for idx,v in pairs(id_t) do\n                if v and cur_state[idx] ~= nil then\n                    cur_state[idx] = true\n                end\n            end\n        end\n    end\n    -- update depending on what we found\n    for idx, v in pairs(cur_state) do\n        local p = prv_state[idx]\n        local s = allstates[idx]\n        if v == true and (p ~= v) then\n            s.value = s.value + 1\n            s.changed = true\n            res = true\n        elseif v == false and (p ~= v) then\n            s.value = s.value - 1\n            s.changed = true\n            res = true\n        end\n    end\n    return res\nend\n\naura_env.AddUnit = function(self, allstates,unit)\n    -- create what buffs that guy needs\n    -- increment totals\n    local name = UnitName(unit)\n    local class = UnitClassBase(unit)\n    self.unit_buff_state[name] = {}\n    self.pending_update[name] = true\n    for idx,s in pairs(allstates) do\n        if s.include[name] or (s.classes[class] and not s.exclude[name]) then\n            self.unit_buff_state[name][idx] = false\n            s.total = s.total + 1\n            s.changed = true\n        end\n    end\n    self.unit_names[name] = true\n    self:RescanUnit(allstates,name)\nend\n\naura_env.RemoveUnit = function(self, allstates,name)\n    if self.unit_names[name] == nil then return end\n    for idx,v in pairs(self.unit_buff_state[name]) do\n        local s = allstates[idx]\n        s.total = s.total - 1\n        s.changed = true\n        if v then\n            s.value = s.value - 1\n        end\n    end\n    self.unit_buff_state[name] = nil\n    self.unit_names[name] = nil\nend\n\naura_env.OnGroupRosterUpdate = function(self, allstates)\n    local res = nil\n    local rescan = nil\n    -- mark all known names as not in group\n    for name,_ in pairs(self.unit_names) do\n        self.unit_names[name] = false\n    end\n    -- add new units that have joined\n    for unit in WA_IterateGroupMembers() do\n        local name = UnitName(unit)\n        if name == UNKNOWNOBJECT then\n            rescan = true\n        elseif self.unit_names[name] == nil then\n            self:AddUnit(allstates,unit)\n            res = true\n            self.unit_names[name] = true\n        else\n            self.unit_names[name] = true\n        end\n    end\n    -- remove units that have left\n    for name,v in pairs(self.unit_names) do\n        if v == false then\n            self:RemoveUnit(allstates,name)\n            res = true\n        end\n    end\n    --o\n    if IsInRaid() then\n        for i=1,40 do\n            local name,_,grp,_,_,class = GetRaidRosterInfo(i)\n            if name then\n                name = string.split(\"-\",name)\n                self.info[name] = {\n                    subgroup = grp,\n                    class = class,\n                }\n            else\n                break\n            end\n        end\n    else\n        for unit in WA_IterateGroupMembers() do\n            local name = UnitName(unit)\n            local class = UnitClassBase(unit)\n            self.info[name] = {\n                subgroup = 1,\n                class = class,\n            }\n        end\n    end\n    \n    if rescan then\n        local id = self.id\n        C_Timer.After(0.5, function() WeakAuras.ScanEvents(\"WA_EVENT_RESCAN\", id) end)\n    end\n    return res\nend\n\nlocal function OverlayOnHide(self)\nend\n\nlocal function OverlayOnShow(self)\n    local p = WeakAuras.GetRegion(self.wa_id, self.wa_clone)\n    self:SetAllPoints(p)\nend\n\nlocal function OverlayOnUpdate(self,elapsed)\n    self.last_update = self.last_update + elapsed\n    if self.last_update < 0.5 then return end\n    self.last_update = 0\n    \n    local p = WeakAuras.GetRegion(self.wa_id, self.wa_clone)\n    if p.state == nil or p.state.buffs == nil then return end\n    GameTooltip:SetOwner(self, \"ANCHOR_TOP\")\n    GameTooltip:ClearLines()\n    GameTooltip:AddDoubleLine(p.state.name, string.format(\"%d / %d\", p.state.value, p.state.total))\n    GameTooltip:AddLine(strjoin(\", \", unpack(p.state.buffs)), 0.7, 0.7, 0.7, true)\n    local data = {}\n    for name,buffs in pairs(self.buffstate) do\n        local val = buffs[self.wa_clone]\n        if val ~= nil then\n            local grp = self.info[name] and self.info[name].subgroup or 1\n            if data[grp] == nil then\n                data[grp] = {\n                    count = 0,\n                    total = 0,\n                    [true] = \"\",\n                    [false] = \"\",\n                }\n            end\n            local _,_,_,color = GetClassColor(self.info[name].class)\n            data[grp][val] = string.format(\"%s|c%s%s|r \", data[grp][val], color, name:sub(1,self.name_length))\n            data[grp].total = data[grp].total + 1\n            data[grp].count = data[grp].count + (val and 1 or 0)\n        end\n    end\n    \n    if self.show_missing or IsShiftKeyDown() then\n        GameTooltip:AddLine(string.format(\"Missing %s.\",p.state.name), 1, 0, 0)\n        for i,tbl in pairs(data) do\n            if tbl.count < tbl.total then\n                GameTooltip:AddDoubleLine(string.format(\"Group %d\", i), string.format(\"%d / %d\", tbl.count, tbl.total))\n                GameTooltip:AddLine(tbl[false],1,1,1,nil)\n            end\n        end\n        GameTooltip:AddLine(\"Left click to report.\", 0.7, 0.7, 0.7, true)\n    end\n    \n    if self.show_found or IsShiftKeyDown() then\n        GameTooltip:AddLine(string.format(\"Found %s.\",p.state.name), 0, 1, 0)\n        for i,tbl in pairs(data) do\n            if tbl.count > 0 then\n                GameTooltip:AddDoubleLine(string.format(\"Group %d\", i), string.format(\"%d / %d\", tbl.count, tbl.total))\n                GameTooltip:AddLine(tbl[true],1,1,1,nil)\n            end\n        end\n        GameTooltip:AddLine(\"Right click to report.\", 0.7, 0.7, 0.7, true)\n    end\n    \n    GameTooltip:Show()\nend\n\nlocal function OverlayOnLeave(self)\n    GameTooltip:Hide()\n    self.last_update = math.huge  \n    self:SetScript(\"OnUpdate\",nil)\n    self:UnregisterEvent(\"MODIFIER_STATE_CHANGED\")\nend\n\nlocal function OverlayOnEnter(self)\n    self:SetScript(\"OnUpdate\", OverlayOnUpdate)\n    self:RegisterEvent(\"MODIFIER_STATE_CHANGED\")\nend\n\nlocal function PrintPlayers(state, status, buffstate, buff_idx, intended_value, send)\n    local msg = string.format(\"%s %d/%d %s on:\", state.name, state.value, state.total, status)\n    for name,buffs in pairs(buffstate) do\n        if buffs[buff_idx] == intended_value then\n            msg = string.format(\"%s %s\", msg, name)\n            if #msg > 200 then\n                send(msg)\n                msg = \"(Cont)\"\n            end\n        end\n    end\n    if #msg > 6 then\n        send(msg)\n    end\nend\n\nlocal function SendFunction()\n    if IsInRaid() then\n        return function(msg) SendChatMessage(msg,\"RAID\") end\n    elseif IsInGroup() then\n        return function(msg) SendChatMessage(msg,\"PARTY\") end \n    else\n        return function(msg) print(msg) end\n    end\nend\n\nlocal function OverlayOnMouseDown(self,btn)\n    local p = WeakAuras.GetRegion(self.wa_id, self.wa_clone)\n    if btn == \"LeftButton\" then\n        PrintPlayers(p.state, \"missing\", self.buffstate, self.wa_clone, false, SendFunction())\n    elseif btn == \"RightButton\" then\n        PrintPlayers(p.state, \"found\", self.buffstate, self.wa_clone, true, SendFunction())\n    end\nend\n\naura_env.Initialize = function(self, a)\n    for _,_ in pairs(a) do\n        return nil\n    end\n    -- state = self.unit_buff_state[unitname][buff_cloneid]\n    -- state is nil if we do not care about that buff on unitname or if we do not care about that unitname\n    -- state is true/false depending if last we knew we found that buff on unitname\n    self.unit_buff_state = {}\n    -- true if unitname in group, nil otherwise\n    -- false temporarily during group roster update to mark units that are still in group\n    self.unit_names = {}\n    -- buffname to clone indicies\n    self.buffname_rev = {}\n    -- buffname needs scan to check for spellid\n    self.buffname_scan = {}\n    -- spellid to clone indicies\n    self.spellid_rev = {}\n    -- true if unitname update is pending, nil otherwise that is we are unsure if the current scan is correct\n    self.pending_update = {}\n    -- used in conjunction with self.config.delay to throttle scans\n    self.last_update = {}\n    -- table that contains information about the player\n    self.info = {}\n    for idx,entry in pairs(self.config.list) do\n        if entry.options.enabled and a[idx] == nil then\n            a[idx] = {\n                color = entry.options.color,\n                value = 0,\n                total = 0,\n                progressType = \"static\",\n                changed = true,\n                show = true,\n                name = entry.display_name,\n                -- non-standard TSU variables\n                hide_empty = entry.options.hide_empty,\n                hide_full = entry.options.hide_full,\n                idx = idx,\n            }\n            a[idx].classes = {}\n            for class,val in pairs(entry.class_filter) do\n                a[idx].classes[class] = val\n            end\n            \n            a[idx].include = {}\n            for match in entry.options.include_names:gmatch(\"([^%s]+)\") do\n                a[idx].include[match] = true\n            end\n            a[idx].exclude = {}\n            for match in entry.options.exclude_names:gmatch(\"([^%s]+)\") do\n                a[idx].exclude[match] = true\n            end\n            -- set up lookup from spellname/id to clone indicies\n            a[idx].buffs = {}\n            for _,v in pairs(entry.buff_filter) do\n                local spell_id = nil\n                local spell_name = nil\n                if v.spell_id_or_name == 1 then\n                    -- name matching\n                    spell_name = v.value\n                elseif v.spell_id_or_name == 2 then\n                    -- loose matching of spellid\n                    spell_id = tonumber(v.value)\n                    spell_name = select(1,GetSpellInfo(spell_id))\n                elseif v.spell_id_or_name == 3 then\n                    -- exact spellid matching\n                    spell_id = tonumber(v.value)\n                    self.buffname_scan[select(1,GetSpellInfo(spell_id))] = true\n                end\n                if spell_name then\n                    a[idx].buffs[#(a[idx].buffs) + 1] = spell_name\n                    if self.buffname_rev[spell_name] == nil then\n                        self.buffname_rev[spell_name] = {}\n                    end\n                    self.buffname_rev[spell_name][idx] = true\n                end\n                if spell_id then\n                    a[idx].buffs[#(a[idx].buffs) + 1] = string.format(\"id:%d\",spell_id)\n                    if self.spellid_rev[spell_id] == nil then\n                        self.spellid_rev[spell_id] = {}\n                    end\n                    self.spellid_rev[spell_id][idx] = true\n                end\n            end\n            --overlay/tooltip frame setup\n            local frame_name = string.format(\"WeakAura_overlay_%s_%s\", self.id, idx)\n            a[idx].overlay = frame_name\n            local f = _G[frame_name]\n            if f == nil then\n                f = CreateFrame(\"Frame\", frame_name, UIParent)\n            end\n            f.wa_id = self.id\n            f.wa_clone = idx\n            f.show_missing = self.config.tooltip_show_missing\n            f.show_found = self.config.tooltip_show_found\n            f.buffstate = self.unit_buff_state\n            f.name_length = self.config.name_length\n            f.info = self.info\n            f.last_update = math.huge\n            f:SetScript(\"OnHide\",OverlayOnHide)\n            f:SetScript(\"OnShow\",OverlayOnShow)\n            f:SetScript(\"OnEnter\",OverlayOnEnter)\n            f:SetScript(\"OnLeave\",OverlayOnLeave)\n            f:SetScript(\"OnMouseDown\",OverlayOnMouseDown)\n            f:SetScript(\"OnEvent\", function(self,event)\n                    if event == \"MODIFIER_STATE_CHANGED\" then\n                        self.last_update = math.huge\n                    end\n            end)\n            \n            -- region setup\n            local region = WeakAuras.GetRegion(self.id, idx)\n            if region ~= nil then\n                region:Color(unpack(entry.options.color))\n                f:Hide()\n                f:Show()\n            end\n        end\n    end\n    return true\nend",
