						["customDuration"] = "",
						["custom"] = "-- UNIT_AURA, CLEU:SPELL_AURA_APPLIED, CLEU:SPELL_AURA_REMOVED, GROUP_ROSTER_UPDATE, WA_EVENT_RESCAN_UNIT, PLAYER_ENTERING_WORLD\nfunction (allstates, event, arg1, arg2, ...)\n    local init = aura_env:Initialize(allstates)\n    local res = nil\n    if event == \"UNIT_AURA\" and arg1 ~= nil then\n        aura_env:TriggerScanAfter(arg1)   \n    elseif event == \"WA_EVENT_RESCAN_UNIT\" and aura_env ~= nil and aura_env.id == arg1 then\n        res = aura_env:RescanUnit(allstates,arg2)\n    elseif event == \"COMBAT_LOG_EVENT_UNFILTERED\" and arg1 ~= nil then\n        res = aura_env:ProcessCLEU(allstates, (arg2==\"SPELL_AURA_APPLIED\"), select(6, ...))\n    elseif event == \"GROUP_ROSTER_UPDATE\"\n    or     event == \"PLAYER_ENTERING_WORLD\" and arg1 ~= nil\n    or     event == \"WA_EVENT_RESCAN\" and arg1 == aura_env.id\n    then\n        res = aura_env:OnGroupRosterUpdate(allstates)\n    elseif event == \"PLAYER_ENTERING_WORLD\" and arg1 == nil then\n        local id = aura_env.id\n        C_Timer.After(1.5, function() WeakAuras.ScanEvents(\"WA_EVENT_RESCAN\", id) end)\n    end\n    \n    for idx,state in pairs(allstates) do\n        local region = WeakAuras.GetRegion(aura_env.id, idx)\n        if region ~= nil then\n            local hide_bar = ((state.value == state.total) and state.hide_full) or ((state.value == 0) and state.hide_empty)\n            if region:IsShown() and hide_bar or init then\n                state.index = #(allstates) + 1\n                state.changed = true\n                region:Hide()\n                _G[state.overlay]:Hide()\n                res = true\n            elseif not region:IsShown() and not hide_bar or init then\n                state.index = idx\n                state.changed = true\n                region:Show()\n                _G[state.overlay]:Show()\n                res = true\n            end\n        end\n    end\n    return res or init\nend",
