					["custom"] = "local function init()\n    aura_env.honor = aura_env.honor or 0\n    aura_env.killsInFight = 0\n    aura_env.honorSumNom = 0\n    aura_env.honorSumReal = 0    \n    aura_env.locale = GetLocale()\n    aura_env.time = aura_env.time or GetTime()\n    aura_env.players = aura_env.players or {}\n    aura_env.kills = aura_env.kills or {}\n    aura_env.pauseTimer = aura_env.pauseTimer or 0\n    aura_env.paused = false\nend\n\naura_env.GetHonor = function (inp)\n    return string.match(inp, \"%d+\")\nend\n\naura_env.GetName = function (inp)\n    local msgName = string.match(inp or \"\", \"^([^%s]+)\")\n    \n    -- In World\n    if GetNumBattlefieldScores() == 0 then \n        return msgName .. \"-\" .. GetRealmName()\n    end\n    \n    -- In BG\n    for i=1,GetNumBattlefieldScores(),1 do \n        local name = GetBattlefieldScore(i) or \"\"\n        if string.find(name, \"-\") or 0 > 0 then -- Player from other realm\n            if string.match(name, \"(.-)-%s*\") == msgName then\n                return name\n            end\n        elseif name == msgName then  -- Player from own realm\n            return name .. \"-\" .. GetRealmName()\n        end\n    end\n    \n    -- In BG, but empty player name on scoreboard\n    return msgName .. \"-Unknown\" \nend\n\naura_env.AddPlayer = function (inp)\n    if aura_env.players[inp] then\n        aura_env.players[inp] = aura_env.players[inp] + 1\n    else\n        aura_env.players[inp] = 1\n    end\nend\n\naura_env.GetDiscountRate = function (inp)\n    \n    local timesKilled = aura_env.players[inp] - 1\n    \n    if timesKilled == 9 then\n        return .9\n    elseif timesKilled == 8 then\n        return .8\n    elseif timesKilled == 7 then\n        return .7\n    elseif timesKilled == 6 then\n        return .6\n    elseif timesKilled == 5 then\n        return .5\n    elseif timesKilled == 4 then\n        return .4\n    elseif timesKilled == 3 then\n        return .3\n    elseif timesKilled == 2 then\n        return .2\n    elseif timesKilled == 1 then\n        return .1\n    elseif timesKilled == 0 then\n        return 0.\n    else\n        return 1.\n    end\n    \nend\n\nlocal function GetSuffix (n)\n    local lastTwo, lastOne = n % 100, n % 10\n    if lastTwo > 3 and lastTwo < 21 then return \"th\" end\n    if lastOne == 1 then return \"st\" end\n    if lastOne == 2 then return \"nd\" end\n    if lastOne == 3 then return \"rd\" end\n    return \"th\"\nend\n\naura_env.AddHonor = function (name,hon)\n    aura_env.kills[name .. aura_env.players[name]] = {GetTime(),hon}\nend\n\naura_env.GetHonorLastHour =  function ()\n    local honorLastHour = 0\n    for _, v in pairs(aura_env.kills) do\n        if v[1] > GetTime()-60*60 then\n            honorLastHour = honorLastHour + v[2]\n        end\n    end\n    return honorLastHour\nend\n\ninit()",
