						["custom"] = "function(e, ...)\n    \n    local txt = select(1,...)\n    \n    if txt ~= nil and aura_env.paused == false then\n        \n        local name = aura_env.GetName(txt)\n        aura_env.AddPlayer(name)\n        local honor_nominal = aura_env.GetHonor(txt)\n        local discount = aura_env.GetDiscountRate(name)\n        local coef = 1 - discount\n        local honor_real = honor_nominal * coef\n        local msg = \"\"\n        \n        if string.match(txt, \"%(\") == nil then -- BG\n            aura_env.honor = aura_env.honor + honor_nominal\n            \n            msg = \"|cff00ff00+honor - \" .. honor_nominal .. \" (BG)|r\"\n            \n            aura_env.AddHonor(name,honor_nominal)\n        else\n            aura_env.honor = aura_env.honor + honor_real\n            aura_env.killsInFight = aura_env.killsInFight + 1\n            aura_env.honorSumNom = aura_env.honorSumNom + honor_nominal\n            aura_env.honorSumReal = aura_env.honorSumReal + honor_real\n            \n            msg = \"|cff00ff00+honor - \" .. honor_real .. \" of \" .. honor_nominal .. \" (\" .. coef * 100 .. \"%)|r\"\n            \n            aura_env.AddHonor(name,honor_real)\n        end\n        \n        if aura_env.config[\"printOpt\"] then print(msg) end\n        \n    end\n    \nend",
