			["displayText"] = "%c1\n",
			["customText"] = "function()\n  if aura_env.inInstance then\n    aura_env.displayString = ''\n    if aura_env.config[\"DisplayXP\"] and aura_env.XPCount ~= nil and aura_env.percentXP ~= nil and aura_env.XPCount > 0 then\n      local currentUnitXPMax = UnitXPMax(\"player\")\n      if UnitXPMax(\"player\") > 0 then\n        aura_env.percentXP = aura_env.XPCount/UnitXPMax(\"player\")*100\n      end\n      aura_env.XPCountString = string.format(\"XP Gain: %d (%.2f%%)\", aura_env.XPCount, aura_env.percentXP)\n      aura_env.XPCountStringColor = string.format(\"XP Gain: |c%s%d|r (|c%s%.2f|r%%)\", \"ffff7afd\", aura_env.XPCount, \"ffff7afd\", aura_env.percentXP)\n      aura_env.displayString = string.format(\"%s%c\",  aura_env.XPCountStringColor, 13)\n    end\n    if aura_env.config[\"DisplayMobCount\"] and aura_env.MobCount ~= nil and aura_env.MobCount > 0 then\n      aura_env.MobCountString = string.format(\"MobCount: %d\", aura_env.MobCount)\n      aura_env.MobCountStringColor = string.format(\"MobCount: |c%s%d|r\", \"ff8e7aff\",aura_env.MobCount)\n      aura_env.displayString = string.format(\"%s%s%c\", aura_env.displayString, aura_env.MobCountStringColor, 13)\n    end\n    if aura_env.config[\"DisplayRepCount\"] and aura_env.Factions ~= nil then\n      for key, value in pairs(aura_env.Factions) do\n        if value[2] ~= value[3] then\n          local repDiff = value[3] - value[2]\n          aura_env.RepCountString = string.format(\"Reputation: %d (%s)\", repDiff, value[1])\n          local repColor = \"ffa63838\"\n          if repDiff > 0 then\n            repColor = \"ff38a640\"\n          end\n          aura_env.RepCountStringColor = string.format(\"Reputation: |c%s%d|r (|c%s%s|r)\", repColor, repDiff, repColor, value[1])\n          aura_env.displayString = string.format(\"%s%s%c\", aura_env.displayString, aura_env.RepCountStringColor, 13)\n        end\n      end\n    end\n    if aura_env.config[\"DisplayHonor\"] and aura_env.HonorCount ~= nil and aura_env.HonorCount > 0 then\n      aura_env.HonorString = string.format(\"Honor: %d\", aura_env.HonorCount)\n      aura_env.HonorStringColor = string.format(\"Honor: |c%s%d|r\", \"fffcba03\",aura_env.HonorCount)\n      aura_env.displayString = string.format(\"%s%s%c\", aura_env.displayString, aura_env.HonorStringColor, 13)\n    end\n    if aura_env.config[\"DisplayTimer\"] and aura_env.StartingTime ~= nil then\n      local s = math.floor(GetTime() - aura_env.StartingTime)\n      local m = math.floor((s / 60) % 60)\n      local h = math.floor((s / 3600) % 60)\n      s = math.floor(s % 60)\n      aura_env.TimerString = string.format(\"Timer: %02d:%02d:%02d\", h, m, s)\n      aura_env.TimerStringColor = string.format(\"Timer: |c%s%02d:%02d:%02d|r\", \"ff8e7aff\",h, m, s)\n      aura_env.displayString = string.format(\"%s%s%c\", aura_env.displayString, aura_env.TimerStringColor, 13)\n    end\n    return aura_env.displayString\n  end\nend",
