en\n            allstates[event] = {\n                show = true,\n                changed = true,\n                autoHide = true,\n                progressType = \"timed\",\n                expirationTime = GetTime() + 3,\n                duration = 3,\n                action = \"POLARITY SHIFT\",\n            }\n            return true\n        end\n    end\nend",
