						["custom"] = "function(allstates, event, _, subEvent, _, _, _, _, _, destGUID, _, _, _, _, spellName)\n    local positive = 28059 -- Positive Charge 28059\n    local negative = 28084 -- Negative Charge 28084\n    -- Show Polarity Shift icon when Thaddius is casting\n    if subEvent == \"SPELL_CAST_START\" and spellName == GetSpellInfo(28089) then -- Polarity Shift 28089\n        WeakAuras.ScanEvents(\"POLARITY_SHIFT\", \"casting\")\n        allstates[event] = {\n            show = true,\n            changed = true,\n            autoHide = true,\n            progressType = \"timed\",\n            expirationTime = GetTime() + 3,\n            duration = 3,\n            icon = 136048\n        }\n        return true\n    end\n    -- If Positive Charge is applied to \"player\"\n    if (subEvent == \"SPELL_AURA_APPLIED\" or subEvent == \"SPELL_AURA_REFRESH\")\n    and spellName == GetSpellInfo(positive) and destGUID == UnitGUID(\"player\") then\n        if subEvent == \"SPELL_AURA_APPLIED\" then \n            WeakAuras.ScanEvents(\"POLARITY_SHIFT\", \"positive\", true)\n            allstates[1] = {\n                show = true,\n                changed = true,\n                autoHide = true,\n                progressType = \"timed\",\n                expirationTime = GetTime() + 5,\n                duration = 5,\n                charge = \"+\",\n                action = \"RIGHT\",\n                icon = 135769\n            }\n        elseif subEvent == \"SPELL_AURA_REFRESH\" then\n            WeakAuras.ScanEvents(\"POLARITY_SHIFT\", \"positive\", false)\n            allstates[1] = {\n                show = true,\n                changed = true,\n                autoHide = true,\n                progressType = \"timed\",\n                expirationTime = GetTime() + 5,\n                duration = 5,\n                charge = \"+\",\n                action = \"STAY\",\n                icon = 135769\n            }\n        end\n        return true\n    elseif (subEvent == \"SPELL_AURA_APPLIED\" or subEvent == \"SPELL_AURA_REFRESH\")\n    and spellName == GetSpellInfo(negative) and destGUID == UnitGUID(\"player\") then\n        if subEvent == \"SPELL_AURA_APPLIED\" then \n            WeakAuras.ScanEvents(\"POLARITY_SHIFT\", \"negative\", true)\n            allstates[1] = {\n                show = true,\n                changed = true,\n                autoHide = true,\n                progressType = \"timed\",\n                expirationTime = GetTime() + 5,\n                duration = 5,\n                charge = \"-\",\n                action = \"LEFT\",\n                icon = 135768\n            }\n        elseif subEvent == \"SPELL_AURA_REFRESH\" then\n            WeakAuras.ScanEvents(\"POLARITY_SHIFT\", \"negative\", false)\n            allstates[1] = {\n                show = true,\n                changed = true,\n                autoHide = true,\n                progressType = \"timed\",\n                expirationTime = GetTime() + 5,\n                duration = 5,\n                charge = \"-\",\n                action = \"STAY\",\n                icon = 135768\n            }\n        end\n        return true\n    end\n    if WeakAuras.IsOptionsOpen() then \n        if (Round(GetTime()) % 2 == 0) then\n            allstates[event] = {\n                show = true,\n                changed = true,\n                autoHide = true,\n                progressType = \"timed\",\n                expirationTime = GetTime() + 5,\n                duration = 5,\n                icon = 135769,\n                charge = \"+\",\n                action = \"RIGHT\"\n            }\n        elseif (Round(GetTime()) % 3 == 0) then\n            allstates[event] = {\n                show = true,\n                changed = true,\n                autoHide = true,\n                progressType = \"timed\",\n                expirationTime = GetTime() + 3,\n                duration = 3,\n                icon = 136048\n            }\n        else\n            allstates[event] = {\n                show = true,\n                changed = true,\n                autoHide = true,\n                progressType = \"timed\",\n                expirationTime = GetTime() + 5,\n                duration = 5,\n                icon = 135768,\n                charge = \"-\",\n                action = \"LEFT\"\n            }\n        end\n        return true\n    end\nend",
