						["custom"] = "function(event,...)\n    --[[    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        local subEvent = select(2, ...)\n        local destFlag = select(10, ...)\n        if subEvent == \"UNIT_DIED\" and (destFlag == 1298 or destFlag == 1300 or destFlag == 66834) then\n            aura_env.checkYes = 0\n        end]]\n    \n    if event == \"GROUP_ROSTER_UPDATE\" or event == \"UNIT_FLAGS\" or event == \"UNIT_FACTION\" then\n        \n        --Create ordered table where class names are same index as said class' ID\n        local nameTable = {\"Warrior\", \"Paladin\", \"Hunter\", \"Rogue\", \"Priest\", \"Death Knight\", \"Shaman\", \"Mage\", \"Warlock\", \"Monk\", \"Druid\", \"Demon Hunter\"}\n        \n        --Create table for class count of equal size to nameTable & set initial values to 0\n        local cTable = {}\n        for j=1, #(nameTable) do\n            cTable[j] = 0\n        end\n        \n        --Iterate through group checking class / dead / online / hostile\n        for unit in WA_IterateGroupMembers() do\n            local classCheck = select(3, UnitClass(unit))\n            local playerDead = UnitIsDeadOrGhost(unit)\n            local playerOnline = UnitIsConnected(unit)\n            local playerHostile = UnitIsEnemy(\"player\", unit)\n            for i=1, #(nameTable) do\n                if not playerDead and playerOnline and not playerHostile and classCheck == i then\n                    --Table index corresponds to classID so if conditions met count +1\n                    cTable[i] = cTable[i] + 1\n                end\n            end\n        end\n        \n        --Create new table and populate with count of each class and the class name string\n        local combTable = {}\n        for k=1, #(cTable) do\n            combTable[k] = cTable[k]..\",\"..nameTable[k]\n        end\n        \n        --Duplicate table to sort high to low class counts\n        local sortComb = combTable\n        table.sort(sortComb, function(a,b) \n                local anum = strsplit(\",\",a)\n                local anum = tonumber(anum)\n                local bnum = strsplit(\",\",b)\n                local bnum = tonumber(bnum)\n                return anum>bnum \n        end)\n        \n        --Store what top 2 classes and how many of each\n        aura_env.numOne,aura_env.classOne = strsplit(\",\", sortComb[1])\n        aura_env.numTwo,aura_env.classTwo = strsplit(\",\", sortComb[2])\n    end\n    local namesTable = {}\n    aura_env.kount = 4\n    for unit in WA_IterateGroupMembers() do\n        local unitClass = select(1, UnitClass(unit))\n        local name = UnitName(unit)\n        if aura_env.kount>0 and unitClass == aura_env.classOne then\n            aura_env.kount = aura_env.kount - 1\n            tinsert(namesTable, name)\n        elseif aura_env.kount == 1 and unitClass == aura_env.classTwo then\n            tinsert(namesTable, name)\n        elseif aura_env.kount == 0 then\n            break\n        end\n    end\n    \n    setglobal(\"TCWA_CCN1\", namesTable[1])\n    if namesTable[2] then\n        setglobal(\"TCWA_CCN2\", namesTable[2])\n    else \n        setglobal(\"TCWA_CCN2\", \"player\")\n    end\n    if namesTable[3] then\n        setglobal(\"TCWA_CCN3\", namesTable[3])\n    else \n        setglobal(\"TCWA_CCN3\", \"player\")\n    end\n    \n    if namesTable[4] then\n        setglobal(\"TCWA_CCN4\", namesTable[4])\n    else \n        setglobal(\"TCWA_CCN4\", \"player\")\n    end\n    \n    return true\nend",
