					["custom"] = "-- this is the healing order if you selected manual ordering in the \"Custom Options\" tab. Put the player's name in the square brackets and quotation marks and on the right side of the equals sign you put their place in the healing order as shown below.\naura_env.healingOrder = {\n    ['examplePriest'] = 1,\n    ['exampleDruid'] = 2,\n    ['examplePaladin'] = 3,\n}\n\n-- players who will NOT appear in the list despite being a healing class. You do not need to add non-healing classes such as warriors and hunters to this list, only paladins, druids, shamans, and priests that you don't want in the healing list.\naura_env.blacklistedPlayers = {\n    ['exampleRetPally'] = true,\n    ['exampleFeralTank'] = true,\n    ['exampleFeralDPS'] = true,\n}\n\naura_env.playerName = UnitName(\"player\")\naura_env.savedDuration = {}\naura_env.savedExpiration = {}\naura_env.debuffDuration = 60\naura_env.lastStateUpdate = 0\n\nfunction aura_env:playerIsBlacklisted(name)\n    for k,v in pairs(aura_env.blacklistedPlayers) do\n        if string.lower(k) == string.lower(name) and v then\n            return true\n        end\n    end\n    \n    return false\nend",
