						["spellIds"] = {
						},
						["custom"] = "function(s,event,_,subEvent, arg2, sourceGUID, sourceName)\n    if (event == \"GROUP_ROSTER_UPDATE\") or (event == \"PLAYER_ENTERING_WORLD\") or (event == \"PLAYER_TARGET_CHANGED\") or (event == \"COMBAT_LOG_EVENT_UNFILTERED\" and (subEvent == \"UNIT_DIED\" or (subEvent == \"SPELL_CAST_SUCCESS\" and GetTime() - aura_env.lastStateUpdate > 1))) then\n        aura_env.lastStateUpdate = GetTime()\n        local myZone = GetRealZoneText() --todo move to aura_env and only change on zone change event to minimize function calls\n        \n        -- Remove\n        for _, state in pairs(s) do\n            local unitName = state.name;\n            local isUnitInvalid = not UnitInParty(unitName)\n            \n            for i = 1, 40 do\n                if UnitName(\"raid\"..i) == unitName then\n                    local _,_,_,_,_,_,zone,online,isDead = GetRaidRosterInfo(i)\n                    if zone ~= myZone or not online or isDead or aura_env:playerIsBlacklisted(unitName) then\n                        isUnitInvalid = true\n                    end\n                    break\n                end\n            end\n            \n            if isUnitInvalid then\n                state.show = false;\n                state.changed = true;\n            end\n        end\n        \n        -- Add        \n        for i = 1, 40 do\n            local unitName = UnitName(\"raid\"..i);\n            local class = select(2,UnitClass(\"raid\"..i))\n            local _,_,_,_,_,_,zone,online,isDead = GetRaidRosterInfo(i)\n            local isUnitValid = (class == \"DRUID\" or class == \"PALADIN\" or class == \"PRIEST\" or class == \"SHAMAN\") and online and not isDead and zone == myZone and not aura_env:playerIsBlacklisted(unitName)\n            \n            if isUnitValid then                \n                s[unitName] = {\n                    show = true,\n                    changed = true, \n                    progressType = \"timed\",\n                    duration = aura_env.savedDuration[unitName] or 0,\n                    expirationTime = aura_env.savedExpiration[unitName] or 0,\n                    name = unitName,\n                    rdyTimer = aura_env.savedExpiration[unitName] or 0,\n                    listOrder = aura_env.config['listOrder'],\n                    index = -1\n                }\n                \n                -- find what the player's index should be if using manual sort                \n                if aura_env.config['listOrder'] == 2 then\n                    for k,v in pairs(aura_env.healingOrder) do\n                        if string.lower(k) == string.lower(unitName) and v then\n                            s[unitName]['index'] = v\n                        end\n                    end\n                end\n            end\n        end\n        \n        return true;\n    elseif event == \"UNIT_AURA\" then\n        for i = 1, 40 do\n            local c = select(2,UnitClass(\"raid\"..i))\n            if c == \"PRIEST\" or c == \"PALADIN\" or c == \"DRUID\" or c == \"SHAMAN\" then\n                local debuffFound = false\n                local playerName = UnitName(\"raid\"..i)\n                \n                for j = 1, 16 do\n                    local debuffID = select(10,UnitDebuff(\"raid\"..i, j))\n                    if debuffID == 29184 or debuffID == 29197 or debuffID == 29195 or debuffID == 29199 then\n                        local t = GetTime()\n                        debuffFound = true\n                        \n                        if s[playerName] ~= nil and s[playerName]['rdyTimer'] - t <= 0 then\n                            s[playerName]['duration'] = aura_env.debuffDuration\n                            s[playerName]['expirationTime'] = t + aura_env.debuffDuration\n                            s[playerName]['name'] = playerName\n                            s[playerName]['rdyTimer'] = t + aura_env.debuffDuration\n                            aura_env.savedDuration[playerName] = s[playerName].duration;\n                            aura_env.savedExpiration[playerName] = s[playerName].expirationTime;\n                            \n                            -- whispers the next player in line that they're doing the next heal\n                            if aura_env.config['whisperNextHealerBool'] == true then\n                                if playerName == aura_env.playerName then\n                                    local playersTable = {}\n                                    local nextPlayerIndex = 0\n                                    \n                                    for k,v in pairs(s) do\n                                        if v ~= nil then\n                                            table.insert(playersTable, v.name)\n                                        end\n                                    end\n                                    \n                                    table.sort(playersTable)\n                                    \n                                    for i = 1, #playersTable do\n                                        if playersTable[i] == playerName then\n                                            if i == #playersTable then\n                                                nextPlayerIndex = 1\n                                            else\n                                                nextPlayerIndex = i + 1\n                                            end \n                                            \n                                            if playersTable[nextPlayerIndex] ~= playerName then SendChatMessage(\"YOU'RE HEALING NEXT\", \"WHISPER\", nil, playersTable[nextPlayerIndex]) end\n                                            break;\n                                        end\n                                    end\n                                end\n                            end\n                            return true;\n                        end\n                    end \n                end\n                \n                if not debuffFound and (s[playerName] ~= nil and s[playerName]['rdyTimer'] - GetTime() < 0) then\n                    s[playerName]['rdyTimer'] = -1 -- we set this to something less than 0 so that the condition that's been set in the Conditions tab will un-toggle\n                end\n            end\n        end\n    end\nend",
