			["useAdjustededMin"] = false,
			["regionType"] = "icon",
			["desc"] = "Displays a clickable button that picks the highest level food available for your pet and feeds it. Shows the cooldown of the debuff on your pet so you know not to spam.",
			["adjustedMax"] = "",
			["config"] = {
				["conjuredFoodPrio"] = true,
				["tooltipOnHover"] = false,
				["showWhenHungry"] = true,
				["updateThrottle"] = 1000,
			},
			["actions"] = {
				["start"] = {
					["do_glow"] = false,
					["custom"] = "aura_env.UpdateFeedButton()",
					["do_custom"] = true,
				},
				["finish"] = {
					["custom"] = "aura_env.DestroyFeedButton()",
					["do_custom"] = false,
				},
				["init"] = {
					["custom"] = "-- Somehow this is needed\nlocal aura_env = aura_env\n\n-- IDs for different foods\nlocal meat = {\n  117, 2287, 2539, 2679, 2681, 2682, 2685, 3727, 3770, 3771, 4599, 5477, 6413,\n  6890, 7097, 8952, 11444, 15935, 17408, 19304, 19223, 19224, 19305, 19306,\n  19995\n}\nlocal fish = {\n  787, 1326, 4592, 4593, 4594, 4592, 4593, 4594, 5095, 6290, 6299, 6887, 7751,\n  7752, 7828, 8364, 8957, 12238, 13546, 13893, 13930, 13933, 13935, 21072,\n  21552\n}\nlocal bread = {\n  1113, 1114, 1487, 4540, 4541, 4542, 4544, 4601, 5349, 8075, 8076, 8950,\n  13724, 19301, 21030, 21236, 22895, 23160, 37836\n}\nlocal fungus = {414, 1707, 4604, 4605, 4606, 4607, 4608, 8543, 8948}\nlocal fruit = {\n  4536, 4537, 4538, 4539, 4602, 4656, 5057, 8953, 11415, 12763, 16168, 19994\n}\nlocal cheese = {414, 422, 1707, 2070, 3927, 8932, 17406}\n\nlocal function GetPetFoodsByName(name)\n  if name == 'Meat' then return meat; end\n  if name == 'Fish' then return fish; end\n  if name == 'Fruit' then return fruit; end\n  if name == 'Fungus' then return fungus; end\n  if name == 'Bread' then return bread; end\n  if name == 'Cheese' then return cheese; end\n  return {};\nend\n\nlocal function GetKnownPetFoods()\n  local knownPetFoods = {};\n  \n  for _, petFoodType in pairs({GetPetFoodTypes()}) do\n    local petFoodItems = GetPetFoodsByName(petFoodType);\n    \n    for _, petFoodItem in pairs(petFoodItems) do\n      knownPetFoods[petFoodItem] = true;\n    end\n  end\n  \n  return knownPetFoods\nend\n\nlocal function GetPetFoodFromBag()\n  -- Get the known pet food mapp\n  local knownPetFoods = GetKnownPetFoods()\n  \n  -- Define the chosen food\n  local foodBag = nil\n  local foodSlot = nil\n  local foodName = ''\n  local foodCount = 0\n  local foodMinLevel = 0\n  local foodConjured = false\n  \n  -- Create the updater fn\n  local UpdateBestFood = function(bag, slot)\n    -- Get the item id from the bags\n    local itemID = C_Container.GetContainerItemID(bag, slot);\n    \n    -- Check if itemId is exists and it's a known pet food\n    if not itemID or not knownPetFoods[itemID] then return false end\n    \n    -- Extract item info and pet level\n    local petLevel = UnitLevel(\"pet\")\n    local itemCount = GetItemCount(itemID)\n    local itemName, itemLink, itemRarity, itemLevel, itemMinLevel = GetItemInfo(itemID);\n    \n    -- Make sure item info exists and the min level is not exceeding pet lvl\n    if not itemName or itemMinLevel <= 0 or itemMinLevel > petLevel then\n      return false\n    end\n    \n    -- Check if item is conjured\n    local itemConjured = itemName:find(\"^Conjured\") ~= nil\n    \n    -- Special logic if conjured food is prioritised\n    if aura_env.config.conjuredFoodPrio then\n      -- If item is conjured\n      if itemConjured and petLevel - itemLevel > 20 then\n        return false\n      end\n      \n      -- If we found a conjured food dont pick anything else\n      if foodConjured and not itemConjured then return false end\n      \n      -- Dont pick lower level food and keep the same conjured status\n      if itemConjured == foodConjured and itemMinLevel < foodMinLevel then\n        return false\n      end\n      \n      -- Pick the food with the bigger count and keep the same conjured status\n      if itemConjured == foodConjured and itemCount <= foodCount then\n        return false\n      end\n    else\n      -- Dont pick lower level food\n      if itemMinLevel < foodMinLevel then return false end\n      \n      -- Pick the food with the bigger count\n      if itemCount <= foodCount then return false end\n    end\n    \n    foodSlot = slot\n    foodBag = bag\n    foodName = itemName\n    foodCount = itemCount\n    foodMinLevel = itemMinLevel\n    foodConjured = itemConjured\n    \n    return true\n  end\n  \n  -- Iterate in each bag\n  for bag = 0, 4 do\n    for slot = 1, C_Container.GetContainerNumSlots(bag) do\n      UpdateBestFood(bag, slot)\n    end\n  end\n  \n  return foodName, foodBag, foodSlot, foodCount;\nend\n\nlocal function OnButtonEnter(self)\n  if not aura_env.config.tooltipOnHover then return; end\n  \n  local bag = self:GetAttribute(\"target-bag\");\n  local slot = self:GetAttribute(\"target-slot\");\n  \n  GameTooltip:SetOwner(self, \"ANCHOR_TOP\", 0, 10);\n  GameTooltip:SetBagItem(bag, slot);\n  GameTooltip:Show();\nend\n\nlocal function OnButtonLeave(self) \n  GameTooltip:Hide() \nend\n\nlocal function UpdateFeedButton()\n  -- Make sure we don't update if we are in combat lockdown\n  if InCombatLockdown() then\n    return\n  end\n  \n  -- Get the boundaries of the weakaura icon\n  local auraFrame = WeakAuras.regions[aura_env.id].region;\n  local feedButton = auraFrame.MikeysFeedPetButton or nil;\n  \n  -- Check if button exists\n  if not feedButton then\n    -- Create the button frame\n    feedButton = CreateFrame(\"Button\", \"MikeysFeedPetButton\", UIParent, \"ActionButtonTemplate,SecureActionButtonTemplate\");\n    feedButton:SetAlpha(0);\n    feedButton:SetAttribute(\"type\", \"spell\");\n    feedButton:SetAttribute(\"spell\", \"Feed Pet\");\n    feedButton:SetScript(\"OnEnter\", OnButtonEnter);\n    feedButton:SetScript(\"OnLeave\", OnButtonLeave);\n    \n    -- Set the button to aura\n    auraFrame.MikeysFeedPetButton = feedButton;\n  end\n  \n  -- If the button is not visible don't update\n  if not feedButton:IsVisible() then \n    return \n  end\n  \n  -- Update the position of the button\n  feedButton:SetAllPoints(auraFrame);\n  \n  -- Update the food\n  local foodName, bag, slot = GetPetFoodFromBag();\n  feedButton:SetAttribute(\"target-bag\", bag);\n  feedButton:SetAttribute(\"target-slot\", slot);\nend\n\nlocal function PrintLogMessage(fromText)\n  if not fromText then return end\n  \n  local _, _, foodName = fromText:find('Your pet begins eating the (.+).')\n  local _, foodLink = GetItemInfo(foodName or '')\n  \n  if not foodLink then return end\n  \n  local petName = UnitName('pet');\n  local foodCount = GetItemCount(foodName);\n  \n  local textTpl = \"You feed %s some %s, %d remaining\";\n  local textStr = string.format(textTpl, petName, foodLink, foodCount);\n  \n  SELECTED_CHAT_FRAME:AddMessage(textStr, 1.0, 0.49, 0.04);\nend\n\naura_env.UpdateFeedButton = UpdateFeedButton;\naura_env.PrintLogMessage = PrintLogMessage;",
					["do_custom"] = true,
				},
